(9092, '_site_transient_wpmdb_addons', 'a:4:{s:29:"wp-migrate-db-pro-media-files";a:6:{s:4:"type";s:7:"feature";s:4:"name";s:11:"Media Files";s:4:"desc";s:412:"Allows you to push and pull your files in the Media Library between two WordPress installs. It can compare both libraries and only migrate those missing or updated, or it can do a complete copy of one sites library to another. <a href="https://deliciousbrains.com/wp-migrate-db-pro/doc/media-files-addon/?utm_campaign=addons%252Binstall&utm_source=MDB%252BPaid&utm_medium=insideplugin">More Details &rarr;</a>";s:7:"version";s:6:"1.4.12";s:12:"beta_version";s:8:"1.4.13b1";s:6:"tested";s:5:"5.0.3";}s:21:"wp-migrate-db-pro-cli";a:7:{s:4:"type";s:7:"feature";s:4:"name";s:3:"CLI";s:4:"desc";s:414:"Integrates WP Migrate DB Pro with WP-CLI allowing you to run migrations from the command line: <code>wp migratedb &lt;push|pull&gt; &lt;url&gt; &lt;secret-key&gt;</code> <code>[--find=&lt;strings&gt;] [--replace=&lt;strings&gt;] ...</code> <a href="https://deliciousbrains.com/wp-migrate-db-pro/doc/cli-addon/?utm_campaign=addons%252Binstall&utm_source=MDB%252BPaid&utm_medium=insideplugin">More Details &rarr;</a>";s:8:"required";s:5:"1.4b1";s:7:"version";s:5:"1.3.4";s:12:"beta_version";s:7:"1.3.5b1";s:6:"tested";s:5:"5.0.3";}s:33:"wp-migrate-db-pro-multisite-tools";a:7:{s:4:"type";s:7:"feature";s:4:"name";s:15:"Multisite Tools";s:4:"desc";s:270:"Export a subsite as an SQL file that can then be imported as a single site install. <a href="https://deliciousbrains.com/wp-migrate-db-pro/doc/multisite-tools-addon/?utm_campaign=addons%252Binstall&utm_source=MDB%252BPaid&utm_medium=insideplugin">More Details &rarr;</a>";s:8:"required";s:7:"1.5-dev";s:7:"version";s:5:"1.2.4";s:12:"beta_version";s:7:"1.2.5b1";s:6:"tested";s:5:"5.0.3";}s:36:"wp-migrate-db-pro-theme-plugin-files";a:7:{s:4:"type";s:7:"feature";s:4:"name";s:20:"Theme & Plugin Files";s:4:"desc";s:277:"Allows you to push and pull your theme and plugin files between two WordPress installs. <a href="https://deliciousbrains.com/wp-migrate-db-pro/doc/theme-plugin-files-addon/?utm_campaign=addons%252Binstall&utm_source=MDB%252BPaid&utm_medium=insideplugin">More Details &rarr;</a>";s:8:"required";s:7:"1.8.2b1";s:7:"version";s:5:"1.0.4";s:12:"beta_version";s:7:"1.0.5b5";s:6:"tested";s:5:"5.0.3";}}', 'no'),
