(9520, 3631, 'details', '<ul>\r\n 	<li>Amazon Business Prime is now available to all Northeastern faculty and staff who have a Northeastern-issued AMEX credit card.</li>\r\n 	<li>Business Prime provides free two-day shipping, discounts on merchandise, and tax exemptions.\r\n<ul>\r\n 	<li>Faculty and staff AMEX cardholders can sign up for Business Prime for free and wont be charged monthly membership fees.</li>\r\n</ul>\r\n</li>\r\n 	<li>Contact Procurement Services at <a href="mailto:procurement@northeastern.edu">procurement@northeastern.edu</a> to learn more.</li>\r\n</ul>'),
