(10488, 3713, 'description', 'To buy goods and services for work purposes, Northeastern employees may choose vendors that have previously been vetted and approved by the university, or may hire new vendors.\r\n\r\nTo find and select an already-approved vendor, use one of three methods: <a href="/tools/mymarketplace/">myMarketplace</a>, the Preferred Suppliers list, or purchasing consortia. Northeasterns preferred channel for buying goods and services is myMarketplace, an e-commerce site. Preferred Suppliers have negotiated pricing and purchasing agreements with Northeastern based on aggregate purchasing volumes. And consortia are companies that pool the purchasing power of like-minded organizations to achieve favorable contract terms on products and services.\r\n\r\nTo hire a new vendor that isnt affiliated with myMarketplace, the Preferred Suppliers list, or purchasing consortia, Northeastern employees must pre-clear the vendor in Banner Finance.'),
