(10577, 3717, 'description', 'Northeastern faculty and staff sometimes must buy goods or services for work-related purposes. Northeasterns preferred channel for purchasing goods or services is the online portal myMarketplace. If you cant make a purchase in myMarketplace, you must use a requisition (for purchases greater than $5,000) or an AMEX card. Another payment tool, Direct Pay, is an option of last resort for purchases less than $5,000. Keep reading to determine which purchasing method is best for you.'),
