(11609, 3765, 'options_group_0_icon', ''),
(11610, 3765, '_options_group_0_icon', 'field_5bc760424ac03'),
(11611, 3765, 'options_group_0_description', 'If you travel on behalf of Northeastern or purchase goods and services on behalf of the university, you should apply for the Northeastern AMEX card, also called the NUCard. The Northeastern AMEX card is an efficient way to make purchases less than $5,000. All Northeastern AMEX cards have a single transaction limit of $5,000 and a monthly limit of $10,000.\r\n\r\nNortheastern AMEX card holders are required to complete Concur training online before activating and using their card. Concur is our tool for reconciling AMEX purchases and reimbursing employees for out-of-pocket expenses.\r\n\r\nIf most of your spending will be for travel, apply for the AMEX IBCP (Green) card. If most of your spending will be to buy goods or services, apply for the AMEX CBS (Blue) card.'),
(11612, 3765, '_options_group_0_description', 'field_5bc75d9f0c3dd'),
