(11818, 3775, 'description', '<span style="font-weight: 400;">Refunds of student-made payments that are </span><i><span style="font-weight: 400;">not </span></i><span style="font-weight: 400;">tuition (for example, workshop registration fees, club sports fees, or application fees) are called departmental (nontuition) refunds. There are different processes for requesting these refunds based on how the transaction was originally processed. </span>'),
