(11832, 3775, 'options_group_0_sub_options_0_description', 'Submit an email request to <a href="mailto:treasvcs@northeastern.edu">treasvcs@northeastern.edu</a> with the following information:\r\n<ul>\r\n 	<li>The 7-digit CASHNet transaction number of the original charge you are refunding, or the customer ID or student ID. This will help us look up the transaction and get the additional details needed to process the refund.</li>\r\n 	<li>The amount you want refunded. Specify the dollar amount, even if you are requesting a complete refund of the original transaction.</li>\r\n 	<li>The reason for the refund.</li>\r\n</ul>'),
