(13202, 3888, 'overview', '<span style="font-weight: 400;">The Controllers Office is responsible for providing timely, reliable, and accurate financial information to the university community. It prepares the universitys annual financial statements, coordinates external financial audits, prepares tax filings, and provides an internal control structure to ensure compliance with university policies as well as state and federal regulations. The Controllers Office comprises the Accounting Office, the Accounts Payable Department, and the Office of Student Loan Collections.</span>'),
