(13576, 3942, 'description', 'SLHC offers 10 percent off of speech-language services and Accent &amp; Communication Training (ACT) for Northeastern faculty and staff. It also offers 10 percent off of new hearing aids for Northeastern students, alumni, faculty, and staff, and their immediate family members. For the hearing aids, a recent (within six months) audiologic evaluation is necessary and can also be scheduled at the SLHC. To learn more, contact SLHC at 617.373.2492 or visit these websites for <a href="https://bouve.northeastern.edu/csd/clinic/accent-and-communication-training-act/">ACT</a>, <a href="https://bouve.northeastern.edu/csd/clinic/speech-language-services/">clinical speech-language services</a>, and <a href="https://bouve.northeastern.edu/csd/clinic/clinical-audiology/">clinical audiology services</a>.'),
