(13694, 3952, '_sub_title', 'field_59e4f3b6699f3'),
(13695, 3952, 'description', 'Seeking experienced PhD level research engineers and scientists in materials and manufacturing to work on a US Army funded program in cold spray material development and additive manufacturing and other related areas. Research work will be primarily experimental, but will include interaction with academic and industry researchers working in modeling and simulation. Researchers will have access to state-of-the-art instrumentation for materials processing, cold-spray additive manufacturing, materials characterization and materials and structure testing. The position provides extensive collaboration opportunities with Northeastern faculty and students and industrial collaborators, providing a unique opportunity and expectation to develop a self-directed research, applied research, and development program. Successful applicants who achieve early success in the position will have the opportunity to assume increasing levels of technical leadership as the Kostas Research Institute grows. Full funding is guaranteed for up to three years as successful applicants attract their own external funding.\r\nUS citizenship and eligibility for security clearance is required; active security clearance preferred.'),
