(14008, 3709, '_options_group_1_sub_options_0_title', 'field_5bc75b78ada52'),
(14009, 3709, 'options_group_1_sub_options_0_description', 'Consortia are companies that pool the purchasing power of like-minded organizations to achieve favorable contract terms on products and services.\r\n\r\nNortheastern is affiliated with the consortia listed below. If your business has negotiated agreements with any of these consortia, contact Procurement Services at <a href="mailto:procurement@northeastern.edu">procurement@northeastern.edu</a> and let us know about the contract and your participation in a consortium. Consortia manage hundreds of contracts, and Procurement Services is not always apprised of new or underutilized contracts.\r\n<ul>\r\n 	<li><a href="http://private.mhec.net/list_all_contracts.aspx">Massachusetts Higher Education Consortium (MHEC)</a></li>\r\n 	<li><a href="https://www.eandi.org/contract-finder/?list=higher-ed">E&amp;I Cooperative Services</a></li>\r\n 	<li><a href="https://www.uscommunities.org/suppliers/all-contracts-by-supplier/">U.S. Communities</a></li>\r\n 	<li><a href="https://www.vizientinc.com/">Vizient</a></li>\r\n</ul>'),
