(16215, 3742, '_options_group_0_sub_options_3_title', 'field_5bc75b78ada52'),
(16216, 3742, 'options_group_0_sub_options_3_description', 'At the top of the JV page, you\'ll see information about who is processing and approving the JV.\r\n\r\n1. In the orange box, see the document number that is automatically assigned by the system.\r\n\r\n2. In green, see the transaction value of the JV (debits and credits).\r\n\r\n3. In yellow, see a tab to attach supporting documentation.\r\n\r\n4. In blue, see the transaction date field. This will be auto-populated with the date that the transaction is approved and is placed in the posting queue. You can manually override this by entering your own date.\r\n\r\n(Note: If the financial period of the override date is open in Banner Finance, it will post to that date. If the financial period of the override date is closed in Banner Finance, the transaction will be processed on the date of the final approval.)'),
(16217, 3742, '_options_group_0_sub_options_3_description', 'field_5bc75b8b34f76'),
(16218, 3742, 'options_group_0_sub_options_4_use_video', '0'),
