(16267, 3742, '_options_group_0_sidebar', 'field_5bfc0ce1f7205'),
(16268, 3742, 'faqs_0_question', 'What supporting documentation must I provide with a JV?'),
(16269, 3742, '_faqs_0_question', 'field_5bd88fdf3ea4f'),
(16270, 3742, 'faqs_0_answer', 'If you are transferring an expense from one budget or expense account to another, please provide a screenshot of an SSB Query or an e-Print report showing where the original charge or expense resides in Banner Finance.\r\n\r\nIf you are reimbursing another department for services provided, please provide an invoice from the department stating the amount owed. You can provide an email chain if no invoice was created.\r\n\r\nIf you are transferring funds for unidentified expenses, please provide an email chain stating the agreed-upon transfer amount and what the transfer is for.\r\n\r\nIf you are transferring awards, please provide a copy of the award letter.'),
(16271, 3742, '_faqs_0_answer', 'field_5bd88fe93ea50'),
(16272, 3742, 'faqs_1_question', 'When will I see my JV posted to Banner Finance?'),
(16273, 3742, '_faqs_1_question', 'field_5bd88fdf3ea4f') ;
INSERT INTO `wp_postmeta` ( `meta_id`, `post_id`, `meta_key`, `meta_value`) VALUES
(16274, 3742, 'faqs_1_answer', 'The Accounting Office posts JVs within five business days of receiving a correctly completed JV with the required signatures and approvals.'),
(16275, 3742, '_faqs_1_answer', 'field_5bd88fe93ea50'),
(16276, 3742, 'faqs_2_question', 'Why was my JV returned?'),
(16277, 3742, '_faqs_2_question', 'field_5bd88fdf3ea4f'),
(16278, 3742, 'faqs_2_answer', 'JVs are returned for many reasons, including but not limited to insufficient supporting documentation, invalid indexes or account codes, inappropriate accounting, or an insufficient fund balance.'),
(16279, 3742, '_faqs_2_answer', 'field_5bd88fe93ea50'),
(16280, 3742, 'faqs_3_question', 'Why does Northeastern use transfer codes?'),
(16281, 3742, '_faqs_3_question', 'field_5bd88fdf3ea4f'),
(16282, 3742, 'faqs_3_answer', 'These codes are used to transfer money within the university. In contrast, we use expense and revenue codes for financial transactions with external parties.'),
(16283, 3742, '_faqs_3_answer', 'field_5bd88fe93ea50'),
(16284, 3742, 'faqs_4_question', 'When should I use transfer codes?'),
(16285, 3742, '_faqs_4_question', 'field_5bd88fdf3ea4f'),
(16286, 3742, 'faqs_4_answer', 'To transfer funding when a budget transfer would not be appropriatefor example, when a department cannot identify a specific expense, or when a department is helping another department pay the costs associated with an event.\r\n\r\nFor example: The Latinx Student Cultural Center needs funding to pay for a new software package. You help pay that expense by using a transfer code. The center uses the money you have transferred to pay for the expense once they receive the bill.\r\n\r\nAnother example: You want to help the Department of Biology run a program or event. Because you are not providing money for a specific expense, you use a transfer code.'),
(16287, 3742, '_faqs_4_answer', 'field_5bd88fe93ea50'),
