(16702, 3752, 'faqs_0_question', 'Ive searched for e-Print in myNortheastern, under Search Services & Links, but I cant find it. What should I do?'),
(16703, 3752, '_faqs_0_question', 'field_5bd88fdf3ea4f'),
(16704, 3752, 'faqs_0_answer', 'Send a screenshot of your search criteria to <a href="mailto:accounting@northeastern.edu">accounting@northeastern.edu</a> and we will follow up.'),
(16705, 3752, '_faqs_0_answer', 'field_5bd88fe93ea50'),
(16706, 3752, 'faqs_1_question', 'I am in the e-Print website but dont see any e-Print reports. What should I do?'),
(16707, 3752, '_faqs_1_question', 'field_5bd88fdf3ea4f') ;
INSERT INTO `wp_postmeta` ( `meta_id`, `post_id`, `meta_key`, `meta_value`) VALUES
(16708, 3752, 'faqs_1_answer', 'If there is an error message, please send the Accounting Office at <a href="mailto:accounting@northeastern.edu">accounting@northeastern.edu</a> a screenshot of the error message. We will examine the error message and follow up.\r\n\r\nIf there is no error message, please check that your <a href="http://myneu.neu.edu">myNortheastern</a> password is 714 characters long and does not contain any special characters (*, &amp;, $, !, etc.). If your password does not meet these criteria, log in to <a href="http://myneu.neu.edu">myNortheastern</a> and change your password. Then try logging in to e<a href="https://eprint.finance.neu.edu/cgi-bin/eprint.cgi">-Print</a>.'),
(16709, 3752, '_faqs_1_answer', 'field_5bd88fe93ea50'),
(16710, 3752, 'faqs_2_question', 'I am missing a few Fund-Org items on my e-Print report. How can I access them?'),
(16711, 3752, '_faqs_2_question', 'field_5bd88fdf3ea4f'),
(16712, 3752, 'faqs_2_answer', 'If you dont see Fund-Orgs, it may be because you never requested access to them, or are not authorized to access them. Contact Procurement Services at <a href="mailto:procurement@northeastern.edu">procurement@northeastern.edu</a> to request access.'),
(16713, 3752, '_faqs_2_answer', 'field_5bd88fe93ea50'),
(16714, 3752, 'faqs_3_question', 'I do not see the payroll report Im looking for in e-Print. Where is it? '),
(16715, 3752, '_faqs_3_question', 'field_5bd88fdf3ea4f'),
(16716, 3752, 'faqs_3_answer', 'Not all faculty and staff are authorized to view payroll information. Have you requested and been approved for payroll-viewing capability? If yes, contact Procurement Services at <a href="mailto:procurement@northeastern.edu">procurement@northeastern.edu</a> and they will validate your access and follow up. If no, request payroll e-Print report access by completing the <a href="https://northeastern.sharepoint.com/sites/finance/intranet/SitePages/Banner%20Finance%20Access%20Request%20-%20User.aspx">Banner Finance Access Request Form</a>.'),
(16717, 3752, '_faqs_3_answer', 'field_5bd88fe93ea50'),
