(19159, 4186, '_title', 'field_5a5e2fd6ce55f'),
(19160, 4186, 'description', 'Alysa Gerlach was appointed vice president and assistant treasurer in July 2017. Gerlach is responsible for all cash operations, investments, and debt management. She also oversees Internal Consulting and the Controllers Office, which includes taxes, accounting, and accounts payable. Gerlach joined Northeastern in November 2014 from the University of Southern California. At USC, she served as assistant treasurer and assistant vice president of treasury. Gerlach hold a bachelors degree from the University of Southern Californias Marshall School of Business. She has a Certified Treasury Professional designation and is an active member of the Treasury Institute of Higher Education.'),
