(21004, 4274, 'title', 'Associate Vice President for Financial Planning, Strategy, and Analytics'),
(21005, 4274, '_title', 'field_5a5e2fd6ce55f'),
(21006, 4274, 'description', 'David Navick began his career at Northeastern University more than 25 years ago in the College of Engineering. He held the titles of teaching assistant, research assistant, lecturer, assistant dean for engineering enrollment, and associate dean for administration and finance. As associate vice provost for budget and planning from 2012 to 2018, Navick facilitated the implementation of a hybrid budget model and the programming of the Interdisciplinary Science and Engineering Complex. He has a bachelors degree in civil engineering from Pennsylvania State University, and is a triple Husky, with masters degrees in civil engineering and engineering management and a doctoral degree in engineering from Northeastern.'),
