(23363, 3723, '_options_group_0_sub_options_2_title', 'field_5bc75b78ada52'),
(23364, 3723, 'options_group_0_sub_options_2_description', 'Complete the What is Being Changed section.\r\n\r\nEnter the purchase order number and supplier name.\r\n\r\nEnter the information that has changed from the original purchase order.\r\n<ul>\r\n 	<li>For changes in description, quantity, or price, enter the current information and then enter the new information.</li>\r\n 	<li>For line changes, enter the line number you would like to change, or select Click Here to Insert Additional Lines.</li>\r\n 	<li>For document text changes, check the Yes box and add new or revised text.</li>\r\n 	<li>For index or account distribution changes, indicate the distribution typeDollar or Percentand then enter the required accounting information.</li>\r\n</ul>\r\nSelect if the supplier should receive the updated purchase order.\r\n\r\nAttach any supporting documentation in the attachments section.'),
(23365, 3723, '_options_group_0_sub_options_2_description', 'field_5bc75b8b34f76'),
