(23374, 3723, 'helpers_1_helper', '4302'),
(23375, 3723, '_helpers_1_helper', 'field_5bcf2f895b481'),
(23376, 3723, 'faqs_0_question', 'How do I request to close or liquidate a purchase order?'),
(23377, 3723, '_faqs_0_question', 'field_5bd88fdf3ea4f'),
(23378, 3723, 'faqs_0_answer', 'In the requested action section of the <a href="https://northeastern.sharepoint.com/sites/finance/PO-Req%20Change/_layouts/15/FormServer.aspx?XsnLocation=/sites/finance/PO-Req%20Change/PO%20Change/Forms/template.xsn#/%23/PO%20Change/Forms/MyItems.aspx">Change or Liquidation Request Form</a>, select PO Liquidation and enter the purchase order number and supplier name. Click on Submit.'),
(23379, 3723, '_faqs_0_answer', 'field_5bd88fe93ea50'),
(23380, 3723, 'faqs_1_question', 'How do I request to close a requisition?'),
(23381, 3723, '_faqs_1_question', 'field_5bd88fdf3ea4f'),
(23382, 3723, 'faqs_1_answer', 'In the requested action section of the <a href="https://northeastern.sharepoint.com/sites/finance/PO-Req%20Change/_layouts/15/FormServer.aspx?XsnLocation=/sites/finance/PO-Req%20Change/PO%20Change/Forms/template.xsn#/%23/PO%20Change/Forms/MyItems.aspx">Change or Liquidation Request Form</a>, select Req Close and enter the purchase order number and supplier name. Click on Submit.'),
(23383, 3723, '_faqs_1_answer', 'field_5bd88fe93ea50'),
