(24881, 3765, '_options_group_0_sub_options_3_title', 'field_5bc75b78ada52'),
(24882, 3765, 'options_group_0_sub_options_3_description', 'When you receive the AMEX card at your home address, complete the<a href="http://finance.localhost/wp-content/uploads/AMEX-Cardholder-Agreementfor-Staff.pdf">AMEX Cardholder Agreementfor Staff</a> or the <a href="http://finance.localhost/wp-content/uploads/AMEX-Cardholder-Agreementfor-Faculty-and-PIs.pdf">AMEX Cardholder Agreementfor Faculty and PIs</a> and send it to Kathrine Dean at <a href="mailto:k.dean@northeastern.edu">k.dean@northeastern.edu</a> to activate your card.'),
(24883, 3765, '_options_group_0_sub_options_3_description', 'field_5bc75b8b34f76'),
(24884, 3765, 'helpers_0_helper', '4213'),
(24885, 3765, '_helpers_0_helper', 'field_5bcf2f895b481'),
(24886, 3765, 'faqs_0_question', 'Were your AMEX charges declined? Did you lose your card? Do you see a fraudulent charge?'),
(24887, 3765, '_faqs_0_question', 'field_5bd88fdf3ea4f'),
(24888, 3765, 'faqs_0_answer', 'Call AMEX at 1.800.528.2122. In addition, please contact Kathrine Dean at <a href="mailto:k.dean@northeastern.edu">k.dean@northeastern.edu</a> to inform her of the situation.\r\n\r\nIf AMEX provides you with a new card, you must email Kathrine Dean at <a href="mailto:k.dean@northeastern.edu">k.dean@northeastern.edu</a> an <a href="http://finance.localhost/wp-content/uploads/AMEX-Cardholder-Agreementfor-Staff.pdf">AMEX Cardholder Agreementfor Staff</a> or the <a href="http://finance.localhost/wp-content/uploads/AMEX-Cardholder-Agreementfor-Faculty-and-PIs.pdf">AMEX Cardholder Agreementfor Faculty and PIs</a> with information related to the new AMEX. Your card will not be activated until you do so.'),
(24889, 3765, '_faqs_0_answer', 'field_5bd88fe93ea50'),
(24890, 3765, 'faqs_1_question', 'When do card limits renew?'),
(24891, 3765, '_faqs_1_question', 'field_5bd88fdf3ea4f'),
(24892, 3765, 'faqs_1_answer', 'Card limits refresh around the 6th of every month.'),
