(25234, 3769, 'faqs_0_question', 'Does Northeastern have a preferred vendor for booking online travel? '),
(25235, 3769, '_faqs_0_question', 'field_5bd88fdf3ea4f'),
(25236, 3769, 'faqs_0_answer', 'Yes: Egencia. Users gain access to negotiated rates on airfare, lodging, and ground transportation. You can request an Egencia account <a href="https://www.egencia.com/pub/agent.dll?qscr=newa&amp;gpid=F42410F5EED6&amp;&amp;zz=1289931335195">here</a>.'),
(25237, 3769, '_faqs_0_answer', 'field_5bd88fe93ea50'),
(25238, 3769, 'faqs_1_question', 'Can I arrange travel for another employee?') ;
INSERT INTO `wp_postmeta` ( `meta_id`, `post_id`, `meta_key`, `meta_value`) VALUES
(25239, 3769, '_faqs_1_question', 'field_5bd88fdf3ea4f'),
(25240, 3769, 'faqs_1_answer', 'Yes. To arrange travel for someone else, both the arranger and traveler must register for an Egencia account <a href="https://www.egencia.com/pub/agent.dll?qscr=newa&amp;gpid=F42410F5EED6&amp;&amp;zz=1289931335195">here</a> and then submit the <a href="http://finance.localhost/wp-content/uploads/Travel-Arranger-Form.pdf">Travel Arranger Form</a> to <a href="mailto:procurement@northeastern.edu">procurement@northeastern.edu</a>.'),
(25241, 3769, '_faqs_1_answer', 'field_5bd88fe93ea50'),
(25242, 3769, 'faqs_2_question', 'What are the most important characteristics of Northeasterns Travel and Expense Policy? '),
(25243, 3769, '_faqs_2_question', 'field_5bd88fdf3ea4f'),
(25244, 3769, 'faqs_2_answer', 'Expense reports must be approved by your next-level supervisor.\r\n\r\nItemized receipts that include the Payor and Method are required for all purchases greater than $75.\r\n\r\nA business purpose is required for all purchases.'),
(25245, 3769, '_faqs_2_answer', 'field_5bd88fe93ea50'),
(25246, 3769, 'faqs_3_question', 'What work- and travel-related expenses are reimbursable? '),
(25247, 3769, '_faqs_3_question', 'field_5bd88fdf3ea4f'),
(25248, 3769, 'faqs_3_answer', 'View <a href="https://www.northeastern.edu/travel/wp-content/uploads/2018/11/Copy-of-reimbursable-expenses-111918.xlsx.pdf">this list</a>.'),
(25249, 3769, '_faqs_3_answer', 'field_5bd88fe93ea50'),
(25250, 3769, 'faqs_4_question', 'Are work-related meals reimbursable? '),
(25251, 3769, '_faqs_4_question', 'field_5bd88fdf3ea4f'),
(25252, 3769, 'faqs_4_answer', 'Yes. The next-level supervisor must review meal charges for reasonableness before approving reimbursement. Employees are always required to provide the business purpose.'),
(25253, 3769, '_faqs_4_answer', 'field_5bd88fe93ea50'),
