(25785, 3771, '_options_group_0_sub_options_1_title', 'field_5bc75b78ada52'),
(25786, 3771, 'options_group_0_sub_options_1_description', 'Fill out the <a href="http://finance.localhost/wp-content/uploads/Department-Deposit-Form.pdf">Department Deposit Form</a>. Please note:\r\n<ul>\r\n 	<li>You must complete all the fields on the form or it will be returned to you.</li>\r\n 	<li>Provide both the Banner Index and Account numbers. If you are unsure what numbers to use, view the <a href="http://finance.localhost/tools/banner/">Banner Codes</a> page or call the Accounting Office at 617.373.2605. Do not use any Banner Finance account numbers that begin with an 8 or 9, or any of the following numbers:</li>\r\n</ul>\r\n50425  50931  50943\r\n\r\n50430  50933  50946\r\n\r\n54100  50936  50995\r\n\r\n54110  50941  73000\r\n<ul>\r\n 	<li>Be brief when writing the description. Only 13 charactersincluding punctuation and spacesare allowed.</li>\r\n 	<li>Treasury Services cannot calculate percentage breakdowns for checks. Please specify dollar amounts for each deposit, especially when a check is going to more than one Banner Finance account.</li>\r\n 	<li>Remove all stubs from checks.</li>\r\n 	<li>Do not staple checks to the deposit form; this can cause a problem when we deposit your check. Attach checks with paper clips or binder clips. If you have a large number of checks to deposit, group them in batches of no more than 25 checks per deposit form. Wrap larger bundles of checks in the deposit form.</li>\r\n 	<li>You do not need to send any backup information for the deposit. We only require that the deposit form and the cash/checks be sent to us.</li>\r\n</ul>'),
