(26869, 3773, '_options_group_0_sub_options_2_title', 'field_5bc75b78ada52'),
(26870, 3773, 'options_group_0_sub_options_2_description', 'For more information, please review the <a href="https://www.northeastern.edu/policies/pdfs/Policy_on_Handling_Payments_Made_to_the_University.pdf">Policy on Handling Payments Made to the University</a>.'),
(26871, 3773, '_options_group_0_sub_options_2_description', 'field_5bc75b8b34f76'),
(26872, 3773, 'faqs_0_question', 'Why is the wire amount received less than the amount that was agreed upon or invoiced?'),
(26873, 3773, '_faqs_0_question', 'field_5bd88fdf3ea4f'),
(26874, 3773, 'faqs_0_answer', 'Certain transfers are subject to a wire fee. This fee is charged by the originating bank (or intermediary bank) used by the payer. Please note that the universitys bank, Bank of America, does not deduct fees from incoming wires. You should therefore discuss with the payer in advance whether their bank charges wire fees and adjust the wire amount if necessary.'),
(26875, 3773, '_faqs_0_answer', 'field_5bd88fe93ea50'),
