(26884, 4463, 'description', 'Employees with purchasing authority have a fiduciary duty to spend the universitys funds responsibly. In addition, when making a purchase with sponsored funds, employees must comply with the sponsor terms and conditions. Northeasterns Procure to Pay (P2P) policy outlines rules that employees must follow to ensure that purchasing is done in an efficient, compliant, and cost-effective manner.'),
