(27079, 4472, '_options_group_0_sub_options_0_title', 'field_5bc75b78ada52'),
(27080, 4472, 'options_group_0_sub_options_0_description', 'Access the <a href="https://northeastern.sharepoint.com/sites/finance/PO-Req%20Change/_layouts/15/FormServer.aspx?XsnLocation=/sites/finance/PO-Req%20Change/PO%20Change/Forms/template.xsn#/%23/PO%20Change/Forms/MyItems.aspx">Change or Liquidation Request Form</a>.\r\n\r\nYour name, department, phone number, and email address will be prefilled. Please verify that this information is correct and enter your phone number if it is not already populated.\r\n\r\nIf you are completing the form on behalf of someone else, check the box If you are not the originator of the document, click here, which will prompt you to enter the requestors name.'),
