(27120, 4472, 'faqs_0_answer', 'In the requested action section of the <a href="https://northeastern.sharepoint.com/sites/finance/PO-Req%20Change/_layouts/15/FormServer.aspx?XsnLocation=/sites/finance/PO-Req%20Change/PO%20Change/Forms/template.xsn#/%23/PO%20Change/Forms/MyItems.aspx">Change or Liquidation Request Form</a>, select PO Liquidation and enter the purchase order number and supplier name. Click on Submit.'),
