(27157, 4475, 'options_group_0_sub_options_0_description', 'Confirm that the following criteria have been met:\r\n<ul>\r\n 	<li>Freedom from controlthe university does not have direct control over the trade or business</li>\r\n 	<li>The work is outside of the usual scope of Northeasterns business</li>\r\n 	<li>The contractor is from an independent trade, occupation, or business.</li>\r\n</ul>'),
