(27230, 4480, 'description', 'There are three types of invoices that can be submitted to the Accounts Payable department: an invoice with a purchase order number, a Direct Pay Form, or an international payment.\r\n\r\nNortheasterns Procure to Pay (P2P) policy requires a <a href="http://finance.localhost/wp-content/uploads/W-9.pdf">W-9</a> from each vendor each fiscal year. We recommend that you always send a <a href="http://finance.localhost/wp-content/uploads/W-9.pdf">W-9</a> with an invoice to prevent a delay in payment.'),
