(28007, 4486, '_use_pre-footer', 'field_5a70888afb1b9'),
(28008, 4486, 'faqs_0_question', 'What supporting documentation must I provide with a JV?'),
(28009, 4486, '_faqs_0_question', 'field_5bd88fdf3ea4f'),
(28010, 4486, 'faqs_0_answer', 'If you are transferring an expense from one budget or expense account to another, please provide a screenshot of an SSB Query or an e-Print report showing where the original charge or expense resides in Banner Finance.\r\n\r\nIf you are reimbursing another department for services provided, please provide an invoice from the department stating the amount owed. You can provide an email chain if no invoice was created.\r\n\r\nIf you are transferring funds for unidentified expenses, please provide an email chain stating the agreed-upon transfer amount and what the transfer is for.\r\n\r\nIf you are transferring awards, please provide a copy of the award letter.'),
(28011, 4486, '_faqs_0_answer', 'field_5bd88fe93ea50'),
(28012, 4486, 'faqs_1_question', 'When will I see my JV posted to Banner Finance?'),
(28013, 4486, '_faqs_1_question', 'field_5bd88fdf3ea4f'),
(28014, 4486, 'faqs_1_answer', 'The Accounting Office posts JVs within five business days of receiving a correctly completed JV with the required signatures and approvals.'),
(28015, 4486, '_faqs_1_answer', 'field_5bd88fe93ea50'),
(28016, 4486, 'faqs_2_question', 'Why was my JV returned?'),
(28017, 4486, '_faqs_2_question', 'field_5bd88fdf3ea4f'),
(28018, 4486, 'faqs_2_answer', 'JVs are returned for many reasons, including but not limited to insufficient supporting documentation, invalid indexes or account codes, inappropriate accounting, or an insufficient fund balance.'),
(28019, 4486, '_faqs_2_answer', 'field_5bd88fe93ea50'),
(28020, 4486, 'faqs_3_question', 'Why does Northeastern use transfer codes?'),
(28021, 4486, '_faqs_3_question', 'field_5bd88fdf3ea4f'),
(28022, 4486, 'faqs_3_answer', 'These codes are used to transfer money within the university. In contrast, we use expense and revenue codes for financial transactions with external parties.'),
(28023, 4486, '_faqs_3_answer', 'field_5bd88fe93ea50'),
(28024, 4486, 'faqs_4_question', 'When should I use transfer codes?'),
(28025, 4486, '_faqs_4_question', 'field_5bd88fdf3ea4f'),
(28026, 4486, 'faqs_4_answer', 'To transfer funding when a budget transfer would not be appropriatefor example, when a department cannot identify a specific expense, or when a department is helping another department pay the costs associated with an event.\r\n\r\nFor example: The Latinx Student Cultural Center needs funding to pay for a new software package. You help pay that expense by using a transfer code. The center uses the money you have transferred to pay for the expense once they receive the bill.\r\n\r\nAnother example: You want to help the Department of Biology run a program or event. Because you are not providing money for a specific expense, you use a transfer code.'),
(28027, 4486, '_faqs_4_answer', 'field_5bd88fe93ea50'),
