(28630, 4491, 'faqs_0_question', 'Ive searched for e-Print in myNortheastern, under Search Services & Links, but I cant find it. What should I do?'),
(28631, 4491, '_faqs_0_question', 'field_5bd88fdf3ea4f'),
(28632, 4491, 'faqs_0_answer', 'Send a screenshot of your search criteria to <a href="mailto:accounting@northeastern.edu">accounting@northeastern.edu</a> and we will follow up.'),
(28633, 4491, '_faqs_0_answer', 'field_5bd88fe93ea50'),
(28634, 4491, 'faqs_1_question', 'I am in the e-Print website but dont see any e-Print reports. What should I do?'),
(28635, 4491, '_faqs_1_question', 'field_5bd88fdf3ea4f'),
(28636, 4491, 'faqs_1_answer', 'If there is an error message, please send the Accounting Office at <a href="mailto:accounting@northeastern.edu">accounting@northeastern.edu</a> a screenshot of the error message. We will examine the error message and follow up.\r\n\r\nIf there is no error message, please check that your <a href="http://myneu.neu.edu">myNortheastern</a> password is 714 characters long and does not contain any special characters (*, &amp;, $, !, etc.). If your password does not meet these criteria, log in to <a href="http://myneu.neu.edu">myNortheastern</a> and change your password. Then try logging in to e<a href="https://eprint.finance.neu.edu/cgi-bin/eprint.cgi">-Print</a>.'),
(28637, 4491, '_faqs_1_answer', 'field_5bd88fe93ea50'),
(28638, 4491, 'faqs_2_question', 'I am missing a few Fund-Org items on my e-Print report. How can I access them?'),
(28639, 4491, '_faqs_2_question', 'field_5bd88fdf3ea4f') ;
INSERT INTO `wp_postmeta` ( `meta_id`, `post_id`, `meta_key`, `meta_value`) VALUES
(28640, 4491, 'faqs_2_answer', 'If you dont see Fund-Orgs, it may be because you never requested access to them, or are not authorized to access them. Contact Procurement Services at <a href="mailto:procurement@northeastern.edu">procurement@northeastern.edu</a> to request access.'),
(28641, 4491, '_faqs_2_answer', 'field_5bd88fe93ea50'),
(28642, 4491, 'faqs_3_question', 'I do not see the payroll report Im looking for in e-Print. Where is it? '),
(28643, 4491, '_faqs_3_question', 'field_5bd88fdf3ea4f'),
(28644, 4491, 'faqs_3_answer', 'Not all faculty and staff are authorized to view payroll information. Have you requested and been approved for payroll-viewing capability? If yes, contact Procurement Services at <a href="mailto:procurement@northeastern.edu">procurement@northeastern.edu</a> and they will validate your access and follow up. If no, request payroll e-Print report access by completing the <a href="https://northeastern.sharepoint.com/sites/finance/intranet/SitePages/Banner%20Finance%20Access%20Request%20-%20User.aspx">Banner Finance Access Request Form</a>.'),
(28645, 4491, '_faqs_3_answer', 'field_5bd88fe93ea50'),
