(29197, 4499, '_sub_title', 'field_5bc75abbada50'),
(29198, 4499, 'options_group_0_title', 'Solution 1: Apply for and use an AMEX card'),
(29199, 4499, '_options_group_0_title', 'field_5bc75d950c3dc'),
(29200, 4499, 'options_group_0_icon', ''),
(29201, 4499, '_options_group_0_icon', 'field_5bc760424ac03'),
(29202, 4499, 'options_group_0_description', 'If you travel on behalf of Northeastern or purchase goods and services on behalf of the university, you should apply for the Northeastern AMEX card, also called the NUCard. The Northeastern AMEX card is an efficient way to make purchases less than $5,000. All Northeastern AMEX cards have a single transaction limit of $5,000 and a monthly limit of $10,000.\r\n\r\nNortheastern AMEX card holders are required to complete Concur training online before activating and using their card. Concur is our tool for reconciling AMEX purchases and reimbursing employees for out-of-pocket expenses.\r\n\r\nIf most of your spending will be for travel, apply for the AMEX IBCP (Green) card. If most of your spending will be to buy goods or services, apply for the AMEX CBS (Blue) card.'),
(29203, 4499, '_options_group_0_description', 'field_5bc75d9f0c3dd'),
(29204, 4499, 'options_group_0_sub_options_0_use_video', '0'),
(29205, 4499, '_options_group_0_sub_options_0_use_video', 'field_5bfc0d0bf7206'),
(29206, 4499, 'options_group_0_sub_options_0_title', 'Step 1'),
(29207, 4499, '_options_group_0_sub_options_0_title', 'field_5bc75b78ada52'),
(29208, 4499, 'options_group_0_sub_options_0_description', 'Complete the <a href="http://finance.localhost/wp-content/uploads/AMEX-ApplicationCBS-Card-Blue.pdf">AMEX ApplicationCBS Card (Blue)</a> or the <a href="http://finance.localhost/wp-content/uploads/AMEX-ApplicationICBP-Card-Green.pdf">AMEX ApplicationICBP Card (Green)</a>.'),
(29209, 4499, '_options_group_0_sub_options_0_description', 'field_5bc75b8b34f76'),
(29210, 4499, 'options_group_0_sub_options_1_use_video', '0'),
