(29225, 4499, '_options_group_0_sub_options_3_title', 'field_5bc75b78ada52'),
(29226, 4499, 'options_group_0_sub_options_3_description', 'When you receive the AMEX card at your home address, complete the<a href="http://finance.localhost/wp-content/uploads/AMEX-Cardholder-Agreementfor-Staff.pdf">AMEX Cardholder Agreementfor Staff</a> or the <a href="http://finance.localhost/wp-content/uploads/AMEX-Cardholder-Agreementfor-Faculty-and-PIs.pdf">AMEX Cardholder Agreementfor Faculty and PIs</a> and send it to Kathrine Dean at <a href="mailto:k.dean@northeastern.edu">k.dean@northeastern.edu</a> to activate your card.'),
