(29258, 4499, 'faqs_0_question', 'Were your AMEX charges declined? Did you lose your card? Do you see a fraudulent charge?'),
(29259, 4499, '_faqs_0_question', 'field_5bd88fdf3ea4f'),
(29260, 4499, 'faqs_0_answer', 'Call AMEX at 1.800.528.2122. In addition, please contact Kathrine Dean at <a href="mailto:k.dean@northeastern.edu">k.dean@northeastern.edu</a> to inform her of the situation.\r\n\r\nIf AMEX provides you with a new card, you must email Kathrine Dean at <a href="mailto:k.dean@northeastern.edu">k.dean@northeastern.edu</a> an <a href="http://finance.localhost/wp-content/uploads/AMEX-Cardholder-Agreementfor-Staff.pdf">AMEX Cardholder Agreementfor Staff</a> or the <a href="http://finance.localhost/wp-content/uploads/AMEX-Cardholder-Agreementfor-Faculty-and-PIs.pdf">AMEX Cardholder Agreementfor Faculty and PIs</a> with information related to the new AMEX. Your card will not be activated until you do so.'),
(29261, 4499, '_faqs_0_answer', 'field_5bd88fe93ea50'),
(29262, 4499, 'faqs_1_question', 'When do card limits renew?'),
