(30230, 4509, 'title', 'Senior Vice President for Finance and Treasurer'),
(30231, 4509, '_title', 'field_5a5e2fd6ce55f'),
(30232, 4509, 'description', 'Thomas Nedell manages Northeasterns financial affairs to ensure that the university has the budgetary resources to achieve its ambitious goals. His portfolio includes campus planning, facilities, human resources, finance, audit and advisory services, and treasury, including oversight of the universitys endowment. Nedell joined Northeastern in 2009 as vice president for finance. Prior to that, he held several positions over 18 years at St. Johns University in New York, including his last post as vice president for business affairs and treasurer. A board member of the Boston Consortium for Higher Education, Nedell holds a bachelors degree from Boston College and a Master of Business Administration from St. Johns University.'),
