(30556, 4513, 'details', 'Amazon Business Prime is now available to all Northeastern faculty and staff who have a Northeastern-issued AMEX credit card.\r\n\r\nBusiness Prime provides free two-day shipping, discounts on merchandise, and tax exemptions.\r\n\r\nFaculty and staff AMEX cardholders can sign up for Business Prime for free and wont be charged monthly membership fees.\r\n\r\nContact Procurement Services at <a href="mailto:procurement@northeastern.edu">procurement@northeastern.edu</a> to learn more.'),
