(30578, 4515, 'description', 'Discounted rates on moving services.\r\n\r\nTo order:\r\n<ul>\r\n 	<li>Online: Go to <a href="http://higheredrelo.com/customers/northeastern.htm">Northeastern Relocation Resources</a> and submit the <a href="http://higheredrelo.com/personalmovereq.htm">Personal Move Services Request Form</a>.</li>\r\n 	<li>By phone or email: Contact Linda Foley at 914.833.4726 or <a href="mailto:lfoley@collinsbros.com">lfoley@collinsbros.com</a> or Helen McNeece at 914.980.2412 or <a href="mailto:hmcneece@higheredrelo.com">hmcneece@higheredrelo.com</a> and note that youre an employee of Northeastern University.</li>\r\n</ul>\r\n&nbsp;\r\n\r\n&nbsp;'),
