(114, 1, 'wp_yoast_notifications', 'a:4:{i:0;a:2:{s:7:"message";s:439:"We&#039;d love for you to try our new and improved Yoast SEO analysis! Use the toggle on the <a href="#top#features" onclick="jQuery(\'#features-tab\').click()">Features tab</a> in your Yoast SEO settings. <a href="https://yoa.st/recalibration-beta-notice?php_version=7.0.32&platform=wordpress&platform_version=4.9.9&software=free&software_version=9.4&role=administrator&days_active=531" target="_blank">Read more about the new analysis</a>.";s:7:"options";a:9:{s:4:"type";s:7:"warning";s:2:"id";s:37:"wpseo-recalibration-meta-notification";s:5:"nonce";N;s:8:"priority";i:1;s:9:"data_json";a:0:{}s:13:"dismissal_key";N;s:12:"capabilities";s:20:"wpseo_manage_options";s:16:"capability_check";s:3:"all";s:14:"yoast_branding";b:0;}}i:1;a:2:{s:7:"message";s:1117:"We\'ve noticed you\'ve been using Yoast SEO for some time now; we hope you love it! We\'d be thrilled if you could <a href="https://yoa.st/rate-yoast-seo?php_version=7.1.6&platform=wordpress&platform_version=4.9.8&software=free&software_version=9.3&role=administrator&days_active=537">give us a 5 stars rating on WordPress.org</a>!\n\nIf you are experiencing issues, <a href="https://yoa.st/bugreport?php_version=7.1.6&platform=wordpress&platform_version=4.9.8&software=free&software_version=9.3&role=administrator&days_active=537">please file a bug report</a> and we\'ll do our best to help you out.\n\nBy the way, did you know we also have a <a href=\'https://yoa.st/premium-notification?php_version=7.1.6&platform=wordpress&platform_version=4.9.8&software=free&software_version=9.3&role=administrator&days_active=537\'>Premium plugin</a>? It offers advanced features, like a redirect manager and support for multiple keyphrases. It also comes with 24/7 personal support.\n\n<a class="button" href="http://finance.localhost/wp-admin/?page=wpseo_dashboard&yoast_dismiss=upsell">Please don\'t show me this notification anymore</a>";s:7:"options";a:9:{s:4:"type";s:7:"warning";s:2:"id";s:19:"wpseo-upsell-notice";s:5:"nonce";N;s:8:"priority";d:0.8000000000000000444089209850062616169452667236328125;s:9:"data_json";a:0:{}s:13:"dismissal_key";N;s:12:"capabilities";s:20:"wpseo_manage_options";s:16:"capability_check";s:3:"all";s:14:"yoast_branding";b:0;}}i:2;a:2:{s:7:"message";s:167:"Don\'t miss your crawl errors: <a href="http://finance.localhost/wp-admin/admin.php?page=wpseo_search_console&tab=settings">connect with Google Search Console here</a>.";s:7:"options";a:9:{s:4:"type";s:7:"warning";s:2:"id";s:17:"wpseo-dismiss-gsc";s:5:"nonce";N;s:8:"priority";d:0.5;s:9:"data_json";a:0:{}s:13:"dismissal_key";N;s:12:"capabilities";s:20:"wpseo_manage_options";s:16:"capability_check";s:3:"all";s:14:"yoast_branding";b:0;}}i:3;a:2:{s:7:"message";s:221:"<strong>Huge SEO Issue: You\'re blocking access to robots.</strong> You must <a href="http://finance.localhost/wp-admin/options-reading.php">go to your Reading Settings</a> and uncheck the box for Search Engine Visibility.";s:7:"options";a:9:{s:4:"type";s:5:"error";s:2:"id";s:32:"wpseo-dismiss-blog-public-notice";s:5:"nonce";N;s:8:"priority";i:1;s:9:"data_json";a:0:{}s:13:"dismissal_key";N;s:12:"capabilities";s:20:"wpseo_manage_options";s:16:"capability_check";s:3:"all";s:14:"yoast_branding";b:0;}}}'),
